values:
In leu of the passing of Shuugeki, my desk just felt so damn lonely ;o;
So I went to Petsmart and found this little guy, who turns out to be a camera whore
and is in love with the tank heater&hearts;
<a href="http://pics.livejournal.com/waka__waka/pic/0000hzf5/"><img src="http://pics.livejournal.com/waka__waka/pic/0000hzf5/s320x240" width="320" height="240" border='0'/></a>

Yes, he is orange. I was so suprised no one had claimed him; he's so pretty <333

He's also got this double-tail thing going on, which may just be a slit in his tail OR
he could be a double-tail betta. Didn't notice it til I had him in the tank though lol.
SO OBSERVANT.

He's my new baby&hearts;

Shuugeki died last night sometime. Sad day today ;A; 2.5 years of happiness&hearts;


<a href="http://pics.livejournal.com/waka__waka/pic/0000r0y1/"><img src="http://pics.livejournal.com/waka__waka/pic/0000r0y1/s320x240" width="320" height="240" border='0'/></a>

I'll miss you pretty boy &hearts;

The fireworks were SPECTACULAR.

Right when they ended, the sprinklers came on and doused everyone.

It was amzing XD &hearts;

My puppy ran away. To the backyard. She's not very smart DX

The deer keep coming back and they're trying to figure out how to get to our flowers. First the bushes, not our flowers. Next it will be the trees. 

This little bunny keeps eating in our front lawn and its so adorable. D: It just sits there and munches happily for hours.&hearts;

The fish seems happy. Swims in circles and comes up when he's hungry. Coolest pet ever. 8D

Who knew old VHS movies were so cool.&hearts;

I think my Kenshin obsession is toning down somewhat, and that's making me pretty sad. I guess I'll just have to try to get re-obsessed again or re-read the series or something.

Today was awsome for SOOO many reasons. :D

I think there's baby birds living in the warehouse of Pricesmart 8D I could hear them chirping&hearts;;o;

There was the coolest lady <b><i>ever</i></b> in the store today DX She was looking for these type of spice things but couldn't remember what they were called, so I wasn't of much use D:<s><font size=1>when am I useful to customers anyways *doesn't even know where BULK!dog food is DDDX*</font></s> Then as I'm walking away I hear this scream cause she found them and then she literally <i>dives</i> into the bin D8   So I walk back and she shows me her hands and says "I made my own gloves with the bags! 8DDD" <s>socoolDX</s>

ANDANDAND THEN WHEN WE WERE COMING HOME, ON MY INTERSECTION THERES THIS COP AND THIS CAR AND ONE WAS REAR-ENDED AND THE OTHER CAR THAT WAS STREET RACING WITH THE REAR-ENDED CAR IS SOMEWHERE DOWN MY ONE WAY STREET RIGHT NOOOOWWWW 8DDDDD!!

BEST DAY <b><u><i>EVER!!</b></u></i>

&hearts;

Ok! So, I <s>burned down the house</s> baked cookies!

They deflate! 8D&hearts;


And theres SNOW!!&hearts;&hearts;

Who wants to build a snowman? :DDD
